Our scream queen Caroline Willams has a new horror holiday feature that we hope to see in 2024. “He Sees You When You’re Sleeping”, is directed by British director Charlie Steeds and his team. 
The film follows Chester, who returns to the home of his estranged, and hideously over-privileged family at Christmas, only to find an unknown killer disguised in a Santa outfit is stalking and killing family members one by one, in order to claim the huge family fortune. But which one of them is the killer?
